var fnObj = {
	initItem: function() {
  	var itemType = $('#init-area #item-type').val()
    var itemUpperAbilityType = $('#init-area #item-upper-ability-type').val()
    var itemLowerAbilityType = $('#init-area #item-lower-ability-type').val()
    var itemLevel = $('#init-area #item-level').val()
    var itemName = $('#init-area #item-name').val()
    
    item.name = itemName
    item.level = itemLevel
    item.type = itemType
    item.ability.upper.type = itemUpperAbilityType
    item.ability.upper.option = ['미지정','미지정','미지정']
    item.ability.lower.type = itemLowerAbilityType
    item.ability.lower.option = ['미지정','미지정','미지정']
    this.isInit = true
    this.refresh()
  },
  isInit: false,
  refresh: function() {
  	$('#red-qtt').text(this.addCommas(log.cubeQtt.redCube))
  	$('#red-price').text(this.addCommas(log.cubeQtt.redCube*900))
    $('#black-qtt').text(this.addCommas(log.cubeQtt.blackCube))
  	$('#black-price').text(this.addCommas(log.cubeQtt.blackCube*1650))
    $('#additional-qtt').text(this.addCommas(log.cubeQtt.additionalCube))
  	$('#additional-price').text(this.addCommas(log.cubeQtt.additionalCube*1890))
    $('#total-price').text(this.addCommas(log.cubeQtt.redCube*900 + log.cubeQtt.blackCube*1650 + log.cubeQtt.additionalCube*1890))
    $('#meso-qtt').text(this.addCommas(log.meso))
    
  	$('#item-info-name').text(item.name)
    if (item.name == '')
    	$('#item-info-name').text('아이템 이름을 적어주세요.')
    $('#item-info-upper-ability>span').text(this.translateRarity(item.ability.upper.type)+'등급')
    $('#item-info-upper-ability>ul>li:eq(0)').text(item.ability.upper.option[0])
    $('#item-info-upper-ability>ul>li:eq(1)').text(item.ability.upper.option[1])
    $('#item-info-upper-ability>ul>li:eq(2)').text(item.ability.upper.option[2])
    $('#item-info-lower-ability>span').text(this.translateRarity(item.ability.lower.type)+'등급')
    $('#item-info-lower-ability>ul>li:eq(0)').text(item.ability.lower.option[0])
    $('#item-info-lower-ability>ul>li:eq(1)').text(item.ability.lower.option[1])
    $('#item-info-lower-ability>ul>li:eq(2)').text(item.ability.lower.option[2])
  },
  translateRarity: function(str) {
  	if (str == 'rare')
    	return '레어'
    else if (str == 'epic')
    	return '에픽'
    else if (str == 'unique')
    	return '유니크'
    else if (str == 'legendary')
    	return '레전더리'
    else
    	return str
  },
  translateCubeType: function(str) {
  	if (str == 'redCube')
    	return '레드큐브'
    else if (str == 'blackCube')
    	return '블랙큐브'
    else if (str == 'additionalCube')
    	return '에디큐브'
    else
    	return str
  },
  addCommas: function(n) {
  	return n.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")
  },
	run: function(cubeType) {
  	if (!this.isInit) 
    	return
    
    log.cubeQtt[cubeType]++
    log.meso += data.mesoCost[item.level]
      
  	var target = item.ability.upper
  	if (cubeType == 'additionalCube')
    	target = item.ability.lower
      
    var logMsg = ''
    
    //등급업 확률
    var rand0 = Math.floor(Math.random()*1000000)
    if (target.type == 'rare' && rand0 < data[cubeType].promotion[0]*10000 ||
    	target.type == 'epic' && rand0 < data[cubeType].promotion[1]*10000 ||
      target.type == 'unique' && rand0 < data[cubeType].promotion[2]*10000) {
      if (target.type == 'rare')
      	target.type = 'epic'
      else if (target.type == 'epic')
      	target.type = 'unique'
      else
      	target.type = 'legendary'
    }
    
    while (true) {
    	//옵션 설정
    	for (var i in target.option) {
      	var rand = Math.floor(Math.random()*1000000)
        var tempCnt = 0
        
        while(true) {
        	rand -= data[cubeType][target.type][item.type][i][tempCnt][1]*10000
          if (rand < 0) {
          	target.option[i] = data[cubeType][target.type][item.type][i][tempCnt][0]
            logMsg += target.option[i] + ' '
            break
          }
          tempCnt++
        }
      }
      
      //예외사항 적용
      var dupFlag = [0, 0, 0, 0, 0, 0, 0]
      for (var i in target.option) {
      	if (target.option[i].indexOf('스킬레벨') > -1)
        	dupFlag[0]++
        if (target.option[i].indexOf('피격 후 무적시간') > -1)
        	dupFlag[1]++
        if (target.option[i].indexOf('몬스터 방어율 무시') > -1)
        	dupFlag[2]++
        if (target.option[i].indexOf('피격 시') > -1 && target.option[i].indexOf('무시') > -1)
        	dupFlag[3]++
        if (target.option[i].indexOf('피격 시') > -1 && target.option[i].indexOf('무적') > -1)
        	dupFlag[4]++
        if (target.option[i].indexOf('보스 몬스터 공격 시 데미지') > -1)
        	dupFlag[5]++
        if (target.option[i].indexOf('아이템 드롭률') > -1)
        	dupFlag[6]++
      }
      if (!(dupFlag[0] > 1 || dupFlag[1] > 1 || dupFlag[2] > 2 || dupFlag[3] > 2 || dupFlag[4] > 2 || dupFlag[5] > 2 || dupFlag[6] > 2)) {
        //console.log(dupFlag)
      	break
      }
    }
    
    //로그 삽입
    $temp = $('<tr></tr>')
    $temp.append('<td>'+(log.logMsg.length+1)+'</td>')
    $temp.append('<td>'+this.translateCubeType(cubeType)+'</td>')
    $temp.append('<td>'+target.option[0]+'</td>')
    $temp.append('<td>'+target.option[1]+'</td>')
    $temp.append('<td>'+target.option[2]+'</td>')
    $('#log-area div table tbody').prepend($temp)
    log.logMsg.push(logMsg)
    
    this.refresh()
  }
}

